import React from 'react';

class List extends React.Component {
    render(){
        const results = this.props.searchedResults.map(result => {
            console.log(results);
               return <div key={result.id}><span>{result.author}</span>
                <span>{result.text}</span>
                <span>{result.url}</span>
                </div>
        })
        return <><div>List</div><div>{results}</div></>
    }
}

export default List;
